export default function Navbar() {
  return (
    <div className="w-[100%] h-[50px] flex items-center justify-between border-solid border-2 border-sky-500">
      <div>Cv Maker by Therakep</div>
      <div className="flex gap-10">
        <a href="/">Home</a>
        <a href="/">Pricing</a>
        <a href="/">Login</a>
      </div>
    </div>
  );
}
